import { Link } from 'react-router-dom';
import React from 'react';
import { AppBar } from '@mui/material';
import { Toolbar } from '@mui/material';
import { Typography } from '@mui/material';
import { Box } from '@mui/material';
import { Container } from '@mui/material';
import AdbIcon from '@mui/icons-material/Adb';


function Header() {
  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <AdbIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            LOGO
          </Typography>

          <Box sx={{ flexGrow: 1 }} />

          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            <Link
              to="/"
              sx={{
                color: 'inherit',
                textDecoration: 'none',
                mr: 2,
                '&:hover': {
                  color: 'primary.main',
                },
              }}
            >
              Home
            </Link>
            <Link
              to="/about"
              sx={{
                color: 'inherit',
                textDecoration: 'none',
                mr: 2,
                '&:hover': {
                  color: 'primary.main',
                },
              }}
            >   
              About
            </Link>
            <Link
              to="/projects"
              sx={{
                color: 'inherit',
                textDecoration: 'none',
                mr: 2,
                '&:hover': {
                  color: 'primary.main',
                },
              }}
            >
              Projects
            </Link>
            <Link
              to="/contact"
              sx={{
                color: 'inherit',
                textDecoration: 'none',
                mr: 2,
                '&:hover': {
                  color: 'primary.main',
                },
              }}
            >
              Contact
            </Link>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
    
  );
}

export default Header;
